import React from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';

import AuthSignInPage from './components/auth/AuthSignInPage';
import AuthSignUpPage from './components/auth/AuthSignUpPage';
import AuthRecoveryPage from './components/auth/AuthRecoveryPage';
import AuthRecoverySentPage from './components/auth/AuthRecoverySentPage';

import './normalize.css';
import './global.css';
import './headings.css';

if (window.location.pathname === '/') {
  window.location.replace('/signin');
}

const App = () => (
  <Router>
    <Switch>
      <Route path="/signin" component={AuthSignInPage} />
      <Route path="/signup" component={AuthSignUpPage} />
      <Route path="/recovery" component={AuthRecoveryPage} />
      <Route path="/recoverysent" component={AuthRecoverySentPage} />
    </Switch>
  </Router>
);

export default App;
